import React from "react";
import TodoItem from "./todoItem";

function Main() {
	return (
		<div className='main'>
			<input type='checkbox' name='animals' id='lion' />
			<span>Lion</span>

			<input type='checkbox' name='animals' id='tiger' />
			<span>Tiger</span>

			<input type='checkbox' name='animals' id='jaguar' />
			<span>Jaguar</span>

			<input type='checkbox' name='animals' id='cheetah' />
			<span>Cheetah</span>
		</div>
	);
}

export default Main;
